import React from 'react';
import '../../css/compornent/common/Header.css'; // CSSファイルをインポート

function Header() {
  return (
    <header className="header">
      <div className="left">
        <h4>ポートフォリオ</h4>
      </div>
      <nav className="right">
        <ul>
          <li><a href="#home">ホーム</a></li>
          <li><a href="#blog">ブログ</a></li>
          <li><a href="#sns">SNS</a></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
